		unchecked {
		    _balances[from] = fromBalance - amount;
		}

        _takeLiquidityReward(from, amount.div(_totalFeeAmount).mul(lpFee));
        _takeFundReward(from, amount.div(_totalFeeAmount).mul(fundFee));
        _takeFomoReward(from, amount.div(_totalFeeAmount).mul(fomoFee));

        uint256 recipientRate = _totalFeeAmount - lpFee - fundFee - fomoFee;
        _balances[to] = _balances[to].add(amount.div(_totalFeeAmount).mul(recipientRate));
        emit Transfer(from, to, amount.div(_totalFeeAmount).mul(recipientRate));
	}

