	    if (fundFee == 0) return;
	    _balances[fundRewardAddress] = _balances[fundRewardAddress].add(tAmount);
	    emit Transfer(sender, fundRewardAddress, tAmount);
	}

	function _takeFomoReward(address sender,uint256 tAmount) private {
	    if (fomoFee == 0) return;
	    _balances[fomoRewardAddress] = _balances[fomoRewardAddress].add(tAmount);
	    emit Transfer(sender, fomoRewardAddress, tAmount);
	}

